cy.request({
    method: "POST",
    url: "https://primecare-api.itpro-mohammed.workers.dev/v1/auth/login",
    body: { email: email, password: password },
    failOnStatusCode: false
}).then(function (response) {
    if (response.status === 200) {
        cy.log("SUCCESS: Found correct password for ".concat(email, " -> ").concat(password));
        expect(response.status).to.equal(200);
    }
    else {
        cy.log("FAILED: ".concat(email, " with ").concat(password, " returned ").concat(response.status));
    }
});

